				["customDuration"] = "function()\n\n    -- === CONFIG SETTINGS BEGIN ===\n\n    -- id: Exact spellId used by the DBM timer creation code\n\n    --    Can also be partially matched string contained in the localized\n\n    --    bar title within DBM .lua (if no spell ID exists).\n\n    local id = 145444;\n\n    -- subId: Additional identifier to prevent timer corruption if multiple triggers exist\n\n    --    with the same \"id\" value.\n\n    local subId = 0;\n    -- === CONFIG SETTINGS END ===\n\n    if DBM then\n    \n        local tId = id..subId;\n    \n        if not (WeakAuras.CustomValues and WeakAuras.CustomValues.DBMTimers and WeakAuras.CustomValues.DBMTimers[tId]) then return 0,0;\n end\n\n        local config = WeakAuras.CustomValues.DBMTimers[tId].config;\n\n        local bar;\n\n        for b in DBM.Bars:GetBarIterator() do\n\n            if strfind(b.id, id) then\n\n                bar = b\n\n            end\n\n        end\n   \n        local tElapsed = bar and (bar.totalTime - bar.timer) or 0, (bar and bar.totalTime) or 0;\n\n        local tRemaining = bar and (bar.timer) or 0, (bar and bar.totalTime) or 0;\n\n        if bar then -- Bar exists\n\n            if config.time <= 0 then config.time = bar.totalTime;\n end\n\n            if config.checkTimeElapsed then\n -- Trigger if time elapsed > time\n\n                if config.duration > 0 then\n\n                    if tElapsed >= config.time and tElapsed <= (config.time + config.duration) then\n\n                        return config.duration, GetTime() + config.duration;\n\n                    end\n\n                elseif tElapsed >= config.time then\n\n                    return (bar.totalTime - config.time), GetTime() + (bar.totalTime - config.time);\n\n                end\n\n            else\n -- Trigger if time remaining < config.time\n\n                if config.duration > 0 then\n\n                    if tRemaining <= config.time and tRemaining > (config.time - config.duration) then\n\n                        return config.duration, GetTime() + config.duration\n\n                    end\n\n                elseif tRemaining <= config.time then\n\n -- totalDuration, GetTime() + config.duration\n\n                    return config.time, GetTime() + config.time;\n\n                end\n\n            end\n\n        end\n\n    end\n\n    return 0,0;\n\nend",
				["custom"] = "function()\n    local config = {};\n\n    -- === CONFIG SETTINGS BEGIN ===\n\n    -- id: Exact spellId used by the DBM timer creation code\n\n    --    Can also be partially matched string contained in the localized\n\n    --    bar title within DBM .lua (if no spell ID exists).\n\n    local id = 145444\n;\n    -- subId: Additional identifier to prevent timer corruption\n \n    --  if multiple triggers exist with the same \"id\" value.\n\n    local subId = 0;\n    -- time: Time remaining at which to trigger (in seconds), can be\n\n    --  decimal. If checkTimeElapsed = true, this is time elapsed at\n \n   --  which to trigger instead.  If zero or negative, time is\n\n    --  automatically set to the total timer duration.\n\n    config.time = 0;\n\n    -- checkTimeElapsed: Default checks against time remaining before the\n\n    --  timer ends. If you want to check against time elapsed instead,\n \n   --  change to \"true\".\n\n    config.checkTimeElapsed = false;\n    -- duration: Duration the trigger should remain active before untrigger, can be decimal.\n    --    If set to default of 0 (zero), trigger expires when timer expires.\n    --    If set to a positive value of say 5, trigger will expire 5 seconds after\n    --    trigger started, as specified by \"time\" above.\n    config.duration = 0;\n   \n    -- === CONFIG SETTINGS END ===\n\n    if DBM then\n    \n        local tId = id..subId;\n\n        if not WeakAuras.CustomValues then WeakAuras.CustomValues = {};\n end\n\n        if not WeakAuras.CustomValues.DBMTimers then WeakAuras.CustomValues.DBMTimers = {};\n end\n        \nif not WeakAuras.CustomValues.DBMTimers[tId] then WeakAuras.CustomValues.DBMTimers[tId] = {};\n end\n\n        WeakAuras.CustomValues.DBMTimers[tId].config = config;\n\n        if WeakAuras.CustomValues.DBMTimers[tId].fired then return false;\n end\n\n        local bar;\n\n        for b in DBM.Bars:GetBarIterator() do\n\n            if strfind(b.id, id) then\n\n                bar = b\n\n            end\n\n        end\n\n        local tElapsed = bar and (bar.totalTime - bar.timer) or 0, (bar and bar.totalTime) or 0;\n\n        local tRemaining = bar and (bar.timer) or 0, (bar and bar.totalTime) or 0;\n\n        if bar then\n -- Bar exists\n\n            if config.time <= 0 then config.time = bar.totalTime;\n end\n\n            if config.checkTimeElapsed then -- Trigger if time elapsed > time\n\n                if config.duration > 0 then\n\n                    if tElapsed >= config.time and tElapsed <= (config.time + config.duration) then\n\n                        WeakAuras.CustomValues.DBMTimers[tId].fired = true;\n\n                        return true;\n\n                    end\n\n                elseif tElapsed >= config.time then\n                    WeakAuras.CustomValues.DBMTimers[tId].fired = true;\n\n                    return true;\n\n                end\n\n            else -- Trigger if time remaining < time\n\n                if config.duration > 0 then\n\n                    if tRemaining <= config.time and tRemaining > (config.time - config.duration) then\n\n                        WeakAuras.CustomValues.DBMTimers[tId].fired = true;\n\n                        return true;\n\n                    end\n\n                elseif tRemaining <= config.time then\n\n                    WeakAuras.CustomValues.DBMTimers[tId].fired = true;\n\n                    return true;\n\n                end\n\n            end\n\n        end\n\n    end\n\n    return false;\n\nend",
